Connect p2p channel
// connect
- (void)viewDidLoad {
    // other code...
    [self.camera connect];
}

// callback for connected success
- (void)cameraDidConnected:(id)camera {
    self.isConnected = YES;
}

// callback for connected faild or disconnected
- (void)cameraDisconnected:(id)camera {
    self.isConnected = NO;
    NSLog(@"---disconnected");
